import React from "react";
import MainPage from "./MainPage";
import Navbar from "./Navbar";
import FoodGallery, {CocktailGallery} from "./Carousel";

function App() {
  return (
    <div>
      <Navbar />
      <MainPage />
      <FoodGallery />
      <CocktailGallery />
    </div>
  );
}

export default App;
